import React, { Component } from 'react';
import Header from './components/Header';
import AlbumsTable from './components/AlbumsTable';
import CustomInput from './components/CustomInput';

class App extends Component {

  render(){
    return (
      <div className="App">
        <Header />

        <CustomInput />
        <CustomInput />
        <AlbumsTable />
      </div>
    );
  }
}

export default App;
